import * as tfjs from '@tensorflow/tfjs'
import React from 'react'

const Main = async () => {
	this.model = await tfjs.loadModel(
		'https: //drive.google.com/open?id=1XJk68dpwsFKnOU5rCUkr9AYKxjZFlzGK');
	console.log('model loaded');
	return null;
}

export default Main;
